import  React,{useState,useEffect} from 'react';
import Grid from '@mui/material/Grid';
import IconButton from '@mui/material/IconButton';
import CallIcon from '@mui/icons-material/Call';
import '../ComponentStyle/Participant.css';
import bgimage from '../images/person.jpeg';
import { w3cwebsocket as WebSocket } from 'websocket';
import io from 'socket.io-client';

const socket = io('http://localhost:3001');

const Userscreen = () => {


  const [timeLeft, setTimeLeft] = useState(0);

  useEffect(() => {
    socket.on('timer', (duration) => {
      setTimeLeft(duration);
    });

    return () => {
      socket.off('timer');
    };
  }, []);

  useEffect(() => {
    if (timeLeft === 0) {
      // play sound
    }
  }, [timeLeft]);

  useEffect(() => {
    if (timeLeft > 0) {
      const intervalId = setInterval(() => {
        setTimeLeft((prevTimeLeft) => prevTimeLeft - 1);
      }, 1000);

      return () => {
        clearInterval(intervalId);
      };
    }
  }, [timeLeft]);



  const buttons = [
    <IconButton key="1" aria-label="call" color="primary" style={{ backgroundColor: '#c4c4c4', borderRadius: '50%' ,margin: '10px'}}><CallIcon /></IconButton>,
    <IconButton key="2" aria-label="call" color="primary" style={{ backgroundColor: '#c4c4c4', borderRadius: '50%' ,margin: '10px'}}><CallIcon /></IconButton>,
    <IconButton key="3" aria-label="call" color="primary" style={{ backgroundColor: '#c4c4c4', borderRadius: '50%' ,margin: '10px'}}><CallIcon /></IconButton>,
    <IconButton key="4" aria-label="call" color="primary" style={{ backgroundColor: '#c4c4c4', borderRadius: '50%' ,margin: '10px'}}><CallIcon /></IconButton>,
    <IconButton key="5" aria-label="call" color="primary" style={{ backgroundColor: '#c4c4c4', borderRadius: '50%' ,margin: '10px'}}><CallIcon /></IconButton>,
    <IconButton key="6" aria-label="call" color="primary" style={{ backgroundColor: '#c4c4c4', borderRadius: '50%' ,margin: '10px'}} ><CallIcon /></IconButton>,
    <IconButton key="7" aria-label="call" color="primary" style={{ backgroundColor: '#c4c4c4', borderRadius: '50%' ,margin: '10px'}} >{timeLeft}</IconButton>,
  ];

  return (
    <Grid container style={{ height: '100vh', position: 'fixed' }}>
      <Grid item xs={12} style={{ height: '50%', background: 'red', border: '1px solid white' }}>
        <Grid container style={{ height: '100%' }}>
          <Grid item xs={6} className='grid1'>
            <div className='part1'>Participant1</div>
          </Grid>
          <Grid item xs={6} className='grid1'>
            <div className='part1'>Participant2</div>
          </Grid>
        </Grid>
      </Grid>
      <Grid item xs={12} style={{ height: '50%', position: 'relative', border: '1px solid white' }}>
        <Grid container style={{ height: '100%', position: 'relative' }}>
          <Grid item xs={6} className='grid1'>
            <div className='part1'>Participant3</div>
          </Grid>
          <Grid item xs={6} className='grid1'>
            <div className='part1'>Participant4</div>
          </Grid>
          <Grid item xs={12} style={{ position: 'absolute', bottom: 0 }}>
            <Grid container justifyContent="center">
              <Grid>
                <center>{buttons} </center> 

              </Grid>
            </Grid>
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
}

export default Userscreen;
